import './App.css';
import gabriela from './img/Gabriela.png';
import React from 'react';
import './Card.css';

// Componente Card
const Card = ({ title, description, linkText }) => {
  return (
    <div className="card">
      <div className="card-content">
        <h2 className="card-title">{title}</h2>
        <p className="card-description">{description}</p>
        <a href="#" className="card-link">{linkText} →</a>
      </div>
    </div>
  );
};

// Componente principal App
function App() {
  return (
    <div className="App">
      {/* Cabeçalho */}
      <header className="App-header">
        <img src={gabriela} className="gabriela-foto" alt="foto" />
        <h1>Gabriela Bárbara</h1>
        <nav className="nav-bar">
          <ul>
            <li><a href="/">Início</a></li>
            <li><a href="/">Sobre mim</a></li>
            <li><a href="/">Feedbacks</a></li>
            <li><a href="https://www.instagram.com/umaestudantedefarmacia/" target="_blank" rel="noopener noreferrer">Contato</a></li>
          </ul>
        </nav>
      </header>

      {/* Cards */}
      <div className="card-container">
        <Card 
          title="Curso Reis do Currículo" 
          description="A enfermagem tem várias possibilidades e ter um bom currículo te prepara para todas elas" 
          linkText="Ver mais"
        />
        <Card 
          title="Cronograma de estudos" 
          description="27 semanas organizadas para provas específicas de enfermagem" 
          linkText="Ver mais"
        />
      </div>
    </div>
  );
}

export default App;
